import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
<div>
  <h2>Covid App</h2>
</div>
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
